const styles = {
    container: {
        padding: '20px',
        textAlign: 'center',
        backgroundColor: '#121212',
        color: '#ffffff',
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'flex-start',
        position: 'relative',
    },
    userContainer: {
        position: 'relative',
        top: 0,
        right: 0,
        textAlign: 'center',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
    },
    tabs: {
        display: 'flex',
        justifyContent: 'center',
        marginBottom: '20px',
    },
    tab: {
        padding: '10px 20px',
        margin: '0 10px',
        border: '1px solid #ccc',
        borderRadius: '5px',
        backgroundColor: '#333',
        color: '#ffffff',
        cursor: 'pointer',
    },
    activeTab: {
        padding: '10px 20px',
        margin: '0 10px',
        border: '1px solid #5fc238',
        borderRadius: '5px',
        backgroundColor: '#5fc238',
        color: '#ffffff',
        cursor: 'pointer',
    },
    card: {
        backgroundColor: '#333',
        color: '#ffffff',
        border: '1px solid #444',
        width: '80%',
        margin: '0 auto',
    },
    strategyContainer: {
        marginTop: '20px',
    },
    strategyText: {
        padding: '0 20px',  // Adds padding to the left and right
        textAlign: 'left',   // Aligns text to the left
        color: '#ffffff',
    },
    buttonContainer: {
        display: 'flex',
        justifyContent: 'center',
        marginTop: '20px',
    },
    confirmButton: {
        borderRadius: '25px',
        backgroundColor: '#5fc238',
        color: '#ffffff',
        marginBottom: '20px',
    },
};
